import '../Sass/editbox.scss';

const EditBox = () =>{
    return(
        <div className="EditBox">
            <div className="multipleInput two">
            {/* Gender  ------------------------------------ */}
            <select className="small" name="gender"  >
                <option value="male"  selected>Mr</option>
                <option value="female" >Mme</option>
            </select>

            {/* Nom et prenom  ------------------------------------ */}

            <input className="input controlled user" type="text" placeholder="Nom" name="nom" />
            <input className="input controlled user" type="text" placeholder="Prenom" name="prenom" />
            </div>
        </div>
    )
}
export default EditBox ;
